import React, { Component } from 'react';
import ReactDom from 'react-dom';

function PortalsDemo() {
    return ReactDom.createPortal(
        <h1>
            Hello Portal
        </h1>,
        document.getElementById('Portal-root')
    )
}

export default PortalsDemo;
